INSERT INTO `organizations` (`organization_id`, `organization_name`, `organization_description`, `logo`) VALUES
(1, 'ICON', 'ICON is a student-led organization that focuses on fostering creativity and innovation. ICON supports students who are passionate about digital arts, graphic design, and emerging technologies. It provides a platform for young creators to showcase their talents and collaborate on futuristic projects.', ),
(2, 'JPIA', 'Junior Philippine Institute of Accountants - Saint Louis University Chapter Junior is the premier organization for students pursuing accounting and finance. JPIA offers academic support, workshops, and networking opportunities, helping members develop both their technical skills and industry knowledge to excel in the field of accountancy.', 0x6c6f676f32),
(3, 'KASAMA', 'KASAMA is dedicated to promoting unity and civic engagement among students. It runs various community outreach programs, leadership training seminars, and social initiatives aimed at empowering student voices and fostering a sense of solidarity.', 0x6c6f676f33),
(4, 'SCHEMA', 'SCHEMA is the go-to organization for aspiring engineers and technologists. SCHEMA focuses on hands-on learning, with workshops on robotics, circuit design, and software development, preparing members for the fast-paced world of engineering.', 0x6c6f676f34),
(5, 'Rated: Production Guild', 'Rated: Production Guild description is an organization centered on film, video production, and multimedia content creation. Its members work on producing short films, documentaries, and digital media content, offering a space for budding directors, producers, and media enthusiasts to hone their craft.', 0x6c6f676f35);
